import React, { useState } from 'react';
import Button from './navitem';
import { FaKey, FaEye } from 'react-icons/fa'; 
import { usePage } from '../PageContext';
import Modal from '../Modal';

const NavbarRight = () => {
  const { currentPage } = usePage();
  const [isModalOpen, setModalOpen] = useState(false);
  const [selectedToys, setSelectedToys] = useState([]);
  const [formData, setFormData] = useState({ firstName1: '', firstName2: '' });

  const openModal = () => {
    setModalOpen(true);
  };

  const closeModal = () => {
    setModalOpen(false);
  };

  const handleSave = (data) => {
    setSelectedToys(data.selectedToys);
    setFormData({
      firstName1: data.nameMan,
      firstName2: data.nameWoman,
    });
    closeModal();
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', position: 'absolute', right: '48px', top: '48px', gap: '10px' }}>
      <Button icon={<FaKey />} label="Filters" onClick={openModal} />
      {currentPage !== 'home' && (
        <Button icon={<FaEye />} label="New Button" /> 
      )}
      <Modal 
        isOpen={isModalOpen} 
        onClose={closeModal} 
        onSave={handleSave} 
        selectedToys={selectedToys}
        formData={formData}
        setFormData={setFormData}  // Vérifiez que cette ligne passe bien la fonction
      />
    </div>
  );
};

export default NavbarRight;
